import React from 'react';

const CourseList = ({ courses, userRatings, onRatingChange, onCourseSelect, suitableCourses }) => {
  const ratingOptions = ['excellent', 'very good', 'good', 'poor', 'not interested'];

  return (
    <div className="max-w-4xl mx-auto">
      {/* Conditionally render the rating section only if userRatings is provided */}
      {userRatings && Object.keys(userRatings).length > 0 && (
        <div className="bg-white rounded-lg shadow-lg p-6 mb-8">
          <h2 className="text-2xl font-semibold mb-4">Rate Your Skills</h2>
          <div className="space-y-6">
            {courses.map(course => (
              <div key={course.id} className="border-b pb-4">
                <h3 className="text-xl font-medium mb-2">{course.name}</h3>
                <div className="flex items-center space-x-4">
                  <span className="text-gray-600">Your Rating:</span>
                  <select
                    value={userRatings[course.id] || ''}
                    onChange={(e) => onRatingChange(course.id, e.target.value)}
                    className="border rounded px-3 py-1"
                  >
                    <option value="">Select Rating</option>
                    {ratingOptions.map(option => (
                      <option key={option} value={option}>
                        {option.charAt(0).toUpperCase() + option.slice(1)}
                      </option>
                    ))}
                  </select>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Render the recommendations section */}
      {suitableCourses && suitableCourses.length > 0 && (
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-2xl font-semibold mb-4">Recommended Courses</h2>
          <div className="grid gap-4">
            {suitableCourses.map(course => (
              <div
                key={course.id}
                className="border rounded-lg p-4 hover:bg-gray-50 cursor-pointer"
                onClick={() => onCourseSelect(course)}
              >
                <h3 className="text-xl font-medium mb-2">{course.name}</h3>
                <p className="text-gray-600">{course.description}</p>

                {/* Display Course Link */}
                {course.resources && course.resources.courseLink && (
                  <div className="mt-2">
                    <a
                      href={course.resources.courseLink}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-blue-500 hover:underline"
                    >
                      Access Course
                    </a>
                  </div>
                )}

                {/* You can add similar logic here to display youtubeLinks and materials if needed */}
                {course.resources && course.resources.youtubeLinks && course.resources.youtubeLinks.length > 0 && (
                  <div className="mt-2">
                    <h4 className="font-semibold">Tutorial Videos:</h4>
                    <ul>
                      {course.resources.youtubeLinks.map((link, index) => (
                        <li key={index}>
                          <a
                            href={link}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="text-blue-500 hover:underline"
                          >
                            Video {index + 1}
                          </a>
                        </li>
                      ))}
                    </ul>
                  </div>
                )}

                {course.resources && course.resources.materials && course.resources.materials.length > 0 && (
                  <div className="mt-2">
                    <h4 className="font-semibold">Materials:</h4>
                    <ul>
                      {course.resources.materials.map((material, index) => (
                        <li key={index}>{material}</li>
                      ))}
                    </ul>
                  </div>
                )}
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Display a message if no recommendations are available */}
      {suitableCourses && suitableCourses.length === 0 && (
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-2xl font-semibold mb-4">Recommended Courses</h2>
          <p className="text-gray-600">Based on your ratings, try improving your skills in some areas to get course recommendations.</p>
        </div>
      )}
    </div>
  );
};

export default CourseList;
